se pas son inclusion.\"},\"sources\":[{\"path\":\"https://youtu.be/J3bYMgqECjU\",\"mime\":\"video/YouTube\",\"copyright\":{\"license\":\"U\"},\"aspectRatio\":\"16:9\"}]},\"library\":\"H5P.Video 1.5\",\"metadata\":{\"contentType\":\"Video\",\"license\":\"U\",\"title\":\"La potence\",\"authors\":[],\"changes\":[],\"extraTitle\":\"La potence\"},\"subContentId\":\"5228453f-39d7-4dfa-abac-1e4b5b9e2e2e\"}],\"header\":\"LA POTENCE\"},{\"position\":{\"x\":84.66819221967964,\"y\":54.85163884364821},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Ce tube à essai sert à chaque fois que l'on a besoin d'agiter le contenu ou de retourner le tube à essai.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Le tube à essai + bouchon\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Le tube à essai + bouchon\"},\"subContentId\":\"7f0ebaee-da20-4e60-b65e-dfd8dbfaf0f3\"}],\"header\":\"Le tube à essai + bouchon\"},{\"position\":{\"x\":74.31350114416476,\"y\":53.51944218241043},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Jamais utile pour manipuler vraiment mais si vous prenez un tube à essai, vous prendrez forcément un goupillon pour nettoyer le tube à essai (avec du liquide vaisselle !).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Le goupillon\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Le goupillon\"},\"subContentId\":\"1b180d53-2639-4fe9-95a5-24e4efd718f0\"}],\"header\":\"LE GOUPILLON\"},{\"position\":{\"x\":93.19221967963387,\"y\":49.82568200325733},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>La pince en bois ne sert pas à tenir un tube à essai (la main ou le porte-tube à essai suffisent amplement) ! Elle sert à le tenir <strong>QUAND ON LE CHAUFFE </strong><strong>SANS SE BRULER</strong> ! Donc, elle va forcément de paire avec la plaque chauffante.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"La pince en bois\",\"authors\":[],\"changes\":[],\"extraTitle\":\"La pince en bois\"},\"subContentId\":\"a84237bf-da21-4f82-ac22-376b068cd036\"}],\"header\":\"LA PINCE EN BOIS\"},{\"position\":{\"x\":70.13729977116705,\"y\":86.68439535830619},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Voici la seule protection que vous devez porter <strong>dès lors que vous avez du matériel en verre sur votre table</strong> et ce, même si vous n'êtes pas entrain de manipuler. Évidemment, elles protègent des projections de liquides mais elles protègent aussi des éclats de verre si vous cassez du matériel !!!</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"LES LUNETTES DE PROTECTION\",\"authors\":[],\"changes\":[],\"extraTitle\":\"LES LUNETTES DE PROTECTION\"},\"subContentId\":\"559fa011-26d7-4412-bf84-df947c47d01b\"}],\"header\":\"LES LUNETTES DE PROTECTION\"},{\"position\":{\"x\":79.17620137299771,\"y\":47.10530333876222},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Le tube à essai sert à faire des tests en petite quantité. Il doit toujours être posé sur un porte-tube à essai et NE DOIT SURTOUT PAS ÊTRE POSÉ À PLAT SUR LA TABLE CAR IL ROULERA ET SE CASSERA !!!</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"LE TUBE À ESSAI\",\"authors\":[],\"changes\":[],\"extraTitle\":\"LE TUBE À ESSAI\"},\"subContentId\":\"7fde70e1-1683-403c-93cc-f4bb4f715b1b\"}],\"header\":\"LE TUBE À ESSAI\"}],\"hotspotNumberLabel\":\"Puce #num\",\"closeButtonLabel\":\"Fermer\",\"image\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA9EAAAKoCAYAAABwanzOAAAgAElEQVR4Xoy9a5Ot2VEmtmrvqnNOSwK1uiXEZQLGHwYktYBxzF9kwH/GwzCX0BUhwEyEw2N/9Eh48BgYQNBqqfvcq2rvXY7MJ5/MJ/N969ilaJ2qvd93XXLl/baufvyHv/ew4udhXS37z34eHvCb/csH/LPDYdkn9rv9XD2sdbm6WvFnfn65XNbV1ZX/d3m4+Pccxz+T7zk/P+PY/o6vw9Zlc651dbX8X
